import React from 'react'

class ComponentA extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            display: "Hello Waterloo"
        }
    }
    render(){
        return (
            <div className='componentA'>
                Hello!
                World!
            </div>
        )
    }
}

export default ComponentA
